import React from 'react'
import "./filter.scss"

const Filter = (props) => {

    const { filterByConsumer } = props;

    return (
        <div>
            <label>Filter by Consumer</label>
            <input type="checkbox" name="" id="" onClick={filterByConsumer}/>
        </div>
    )
}

export default Filter
